  true,\n\t\"url\": null,\n\t\"notes\": \"The FHWA Organization Information System
  (FOIS) is a Web-enabled application that contains several different sections allowing
  users to see information about different divisions relating to FTEs, Budget, Briefing
  Documents and Major Projects. Additionally, FOIS contains a list of Division and
  Assistant Division Administrators with their associated biographies, a list of SES
  and Resource Center Managers. Users only see and maintain the sections they are
  allowed to update. Below is a brief description of each module. The Briefings module
  stores briefings for all associated FHWA offices. Users belonging  to Program and
  Division Offices are responsible for maintaining briefing information on projects
  and issues pertaining to their organizations.\",\n\t\"license_title\": \"Other License
